import { FETCH_USERS, NEW_USERS } from "../types";

export function fetchUsers() {
    return function(dispatch){
        fetch('http://jsonplaceholder.typicode.com/users')
        .then(res => res.json())
        .then(users  => dispatch({
            type: FETCH_USERS,
            payload: users
        }))
    }
}
